import { IoSearch } from "react-icons/io5";
const SearchBar = () => {
    return(
        <div className="w-full py-2.5 flex justify-center h-full">
            <div className="max-w-[1240px]">
                <div class="flex justify-between items-center px=10 py-3rounded-lg border-2 border-black gap-4 rounded-full">
                    <IoSearch className=""/>
                    <input class="appearance-none bg-transparent border-none w-full text-gray-700 mr-3 py-1 px-2 leading-tight focus:outline-none " type="text" placeholder="Input Job"/>
                    <button class="font-black transition-colors duration-100 ease-in-out text-gray-600 py-2 pr-4 pl-10 block w-full appearance-none leading-normal border border-transparent rounded-lg text-left select-none truncate"> Search</button>
                </div>
            </div>
        </div>
    )
}

export default SearchBar
